  false,\n\t\"url\": null,\n\t\"notes\": \"The Glacial Features (Line) layer describes
  linear features associated with surficial geology. These glacial features include,
  but are not limited to, Wisconsinan synglacial sea extents, meltwater channels,
  meltwater spillways, ice margins and eskers. This layer also includes non-glacial
  exposures such as gravel pit extents. An associated DBASE table (GLAC_DESC154L.dbf)
  is available with glacial feature descriptions.\",\n\t\"license_title\": null,\n\t\"extras\":
